import { Link } from 'react-router-dom';
import { Button } from '@material-ui/core';

const Home = () => {
    return (
        <div>
            TO GO TO THE POKEDEX CLICK HERE
            <Button component={Link} to="/pokemons">POKEDEX</Button><br></br>
            TO GET MORE IN-DEPTH INFORMARTION ABOUT A SPECIFIC POKEMON, JUST CLICK IT!
        </div>
    );
};

export default Home;
